// DashboardStats.jsx

import React from 'react';
import '../sty/DashboardStats.css';

const DashboardStats = ({ numberOfTours, numberOfUsers, numberOfBookings }) => {
  return (
    <div className="dashboard-stats">
      <div className="stat">
        <h2>{numberOfTours}</h2>
        <p>Tours</p>
      </div>
      <div className="stat">
        <h2>{numberOfUsers}</h2>
        <p>Users</p>
      </div>
      <div className="stat">
        <h2>{numberOfBookings}</h2>
        <p>Bookings</p>
      </div>
    </div>
  );
};

export default DashboardStats;
